B.Hc=new A.dr(B.a0U,B.a1J,"Yandi Idris was an addict. From the first time the hot and sweet fumes of a singing petrol engine filled his nose, he could find no other joy. He said that the first time he pressed that nitro oxide button was like touching the face of God. Mystical, irrational, and dangerous, the Cult of Speed spread like wildfire after Idris's meteoric rise during the 2012 Gaslands season. He crossed the final finishing line in a ball of fire and his body was never found. His fanatical followers say that at 201 mph, you can hear his sonorous voice on the rushing headwind.",2,"idris")
